import React, { useState, useEffect } from 'react';
import Axios from 'axios';
import { Navbar, Nav, Card, Container, Row, Col } from 'react-bootstrap';

function Home() {
  const [vehicles, setVehicles] = useState([]);

  useEffect(() => {
    Axios.get('http://127.0.0.1:8000/api/vehicles/')
      .then((response) => {
        setVehicles(response.data);
      })
      .catch((error) => {
        console.error('Error fetching vehicle data:', error);
      });
  }, []);

  return (
    <div>
      <Navbar bg="light" expand="lg">
        <Container>
          <Navbar.Brand href="/">VehicleVerse</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="ml-auto">
              <Nav.Link href="/">Home</Nav.Link>
              <Nav.Link href="/post">Post</Nav.Link>
              <Nav.Link href="/rent">Rent</Nav.Link>
              <Nav.Link href="/profile">Profile</Nav.Link>
              <Button variant="danger" href="/logout">
                Log Out
              </Button>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
      <Container className="mt-4">
        <h1 className="text-center">Vehicle Listings</h1>
        <Row>
          {vehicles.map((vehicle) => (
            <Col key={vehicle.id} md={4}>
              <Card className="mb-4">
                <Card.Img src={vehicle.image} alt="Vehicle" />
                <Card.Body>
                  <Card.Title>Vehicle Type: {vehicle.vehicle_type}</Card.Title>
                  <Card.Text>Make: {vehicle.make}</Card.Text>
                  <Card.Text>Model: {vehicle.model}</Card.Text>
                  <Card.Text>Year: {vehicle.year}</Card.Text>
                  <Card.Text>Phone Number: {vehicle.phone_number}</Card.Text>
                  <Card.Text>Price: {vehicle.price}</Card.Text>
                  <Card.Text>Description: {vehicle.description}</Card.Text>
                </Card.Body>
              </Card>
            </Col>
          ))}
        </Row>
      </Container>
    </div>
  );
}

export default Home;
